package wxxx

import (
	"context"
	"encoding/base64"
	"encoding/hex"
	"github.com/stretchr/testify/assert"
	"testing"
)

func TestClient_GetLoginQrCode(t *testing.T) {
	ctx := context.Background()
	cli := NewClient(NewDefaultHttpCli(ctx))
	resp, err := cli.GetLoginQrCode("")
	if !assert.NoError(t, err) {
		t.FailNow()
	}
	Log.Printf("aeskey = %s , qrCodeId = %s >> %s", ArrToHexStrWithSp(resp.AesKey, ""), resp.QRCodeId, base64.StdEncoding.EncodeToString(resp.QRCodeContent))
}

func TestUnpack(t *testing.T) {
	key, _ := hex.DecodeString("CD519D776CB40706117171E880788350")
	data, _ := hex.DecodeString("\nafter AESDecrypt = ")
	decrypted := AESCbcDecrypt(data, key)
	Log.Printf("decrypted = %s\n", ArrToHexStrWithSp(decrypted, ""))
	unziped, _ := deflateUnZip(decrypted)
	Log.Printf("unziped = %s\n", ArrToHexStrWithSp(unziped, ""))
}
